import React from "react";

const axios = require("axios");

const ModelApi = (props) => {
  const [state, setState] = React.useState({ message: "Default" });
  const [modelResponse, setModelResponse] = React.useState([]);

  React.useEffect(() => {
    axios
      .get(`/api/model_result`, {
        params: {
          chosenTime: parseInt(props.timeDayMonth[0]),
          chosenDay: props.timeDayMonth[1],
          chosenMonth: props.timeDayMonth[2],
        },
      })
      .then((res) => {
        const modelResponse = res.data;
        setModelResponse(modelResponse);
      });
  }, []);

  const updateContent = () => {
    setState({ message: "Updated Content!" });
  };

  return (
    <div>
      <div className="h1 bg-secondary text-white text-center p-2">
        {state.message}
      </div>
      <div className="text-center">
        <button className="btn btn-secondary" onClick={updateContent}>
          Click Me
        </button>
      </div>
    </div>
  );
};

export default ModelApi;
